import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import BaseLayout from './BaseLayout';

const CreateAppraisal = ({ user }) => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    address: '',
    bedrooms: '',
    bathrooms: '',
    property_type: '',
    land_size: '',
    floor_area: '',
    condition: '',
    features: []
  });
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleCheckboxChange = (e) => {
    const { value, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      features: checked 
        ? [...prev.features, value]
        : prev.features.filter(feature => feature !== value)
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setError('');

    try {
      const response = await fetch('/api/appraisal', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
        body: JSON.stringify(formData)
      });

      const data = await response.json();

      if (response.ok) {
        // Redirect to the new appraisal
        navigate(`/appraisal/${data.appraisal_id}`);
      } else {
        setError(data.error || 'Failed to create appraisal');
      }
    } catch (err) {
      setError('Network error. Please try again.');
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <BaseLayout user={user}>
      <div className="px-40 flex flex-1 justify-center py-5">
        <div className="layout-content-container flex flex-col w-[512px] max-w-[512px] py-5 max-w-[960px] flex-1">
          <div className="flex flex-wrap justify-between gap-3 p-4">
            <div className="flex min-w-72 flex-col gap-3">
              <p className="text-[#0d141c] tracking-light text-[32px] font-bold leading-tight">Start Valuation</p>
              <p className="text-[#49719c] text-sm font-normal leading-normal">Enter the property details to begin your valuation.</p>
            </div>
          </div>

          {error && (
            <div className="mx-4 mb-4 p-3 bg-red-100 border border-red-400 text-red-700 rounded">
              {error}
            </div>
          )}

          <form onSubmit={handleSubmit} className="space-y-6">
            <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
              <label className="flex flex-col min-w-40 flex-1">
                <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Address</p>
                <input
                  name="address"
                  value={formData.address}
                  onChange={handleInputChange}
                  placeholder="Enter property address"
                  className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-xl text-[#0d141c] focus:outline-0 focus:ring-0 border-none bg-[#e7edf4] focus:border-none h-14 placeholder:text-[#49719c] p-4 text-base font-normal leading-normal"
                  required
                />
              </label>
            </div>

            <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
              <label className="flex flex-col min-w-40 flex-1">
                <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Bedrooms</p>
                <input
                  name="bedrooms"
                  type="number"
                  value={formData.bedrooms}
                  onChange={handleInputChange}
                  placeholder="Select"
                  className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-xl text-[#0d141c] focus:outline-0 focus:ring-0 border-none bg-[#e7edf4] focus:border-none h-14 placeholder:text-[#49719c] p-4 text-base font-normal leading-normal"
                />
              </label>
              <label className="flex flex-col min-w-40 flex-1">
                <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Bathrooms</p>
                <input
                  name="bathrooms"
                  type="number"
                  value={formData.bathrooms}
                  onChange={handleInputChange}
                  placeholder="Select"
                  className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-xl text-[#0d141c] focus:outline-0 focus:ring-0 border-none bg-[#e7edf4] focus:border-none h-14 placeholder:text-[#49719c] p-4 text-base font-normal leading-normal"
                />
              </label>
            </div>

            <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
              <label className="flex flex-col min-w-40 flex-1">
                <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Property Type</p>
                <select
                  name="property_type"
                  value={formData.property_type}
                  onChange={handleInputChange}
                  className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-xl text-[#0d141c] focus:outline-0 focus:ring-0 border-none bg-[#e7edf4] focus:border-none h-14 bg-[image:--select-button-svg] placeholder:text-[#49719c] p-4 text-base font-normal leading-normal"
                >
                  <option value="">Select</option>
                  <option value="house">House</option>
                  <option value="apartment">Apartment</option>
                  <option value="townhouse">Townhouse</option>
                </select>
              </label>
            </div>

            <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
              <label className="flex flex-col min-w-40 flex-1">
                <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Land Size (Acres)</p>
                <input
                  name="land_size"
                  type="number"
                  step="0.01"
                  value={formData.land_size}
                  onChange={handleInputChange}
                  placeholder="Enter land size"
                  className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-xl text-[#0d141c] focus:outline-0 focus:ring-0 border-none bg-[#e7edf4] focus:border-none h-14 placeholder:text-[#49719c] p-4 text-base font-normal leading-normal"
                />
              </label>
              <label className="flex flex-col min-w-40 flex-1">
                <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Floor Area (sq ft)</p>
                <input
                  name="floor_area"
                  type="number"
                  step="0.01"
                  value={formData.floor_area}
                  onChange={handleInputChange}
                  placeholder="Enter floor area"
                  className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-xl text-[#0d141c] focus:outline-0 focus:ring-0 border-none bg-[#e7edf4] focus:border-none h-14 placeholder:text-[#49719c] p-4 text-base font-normal leading-normal"
                />
              </label>
            </div>

            <div className="flex max-w-[480px] flex-wrap items-end gap-4 px-4 py-3">
              <label className="flex flex-col min-w-40 flex-1">
                <p className="text-[#0d141c] text-base font-medium leading-normal pb-2">Condition (1-10)</p>
                <select
                  name="condition"
                  value={formData.condition}
                  onChange={handleInputChange}
                  className="form-input flex w-full min-w-0 flex-1 resize-none overflow-hidden rounded-xl text-[#0d141c] focus:outline-0 focus:ring-0 border-none bg-[#e7edf4] focus:border-none h-14 bg-[image:--select-button-svg] placeholder:text-[#49719c] p-4 text-base font-normal leading-normal"
                >
                  <option value="">Select</option>
                  {[...Array(10)].map((_, i) => (
                    <option key={i + 1} value={i + 1}>{i + 1}</option>
                  ))}
                </select>
              </label>
            </div>

            <h3 className="text-[#0d141c] text-lg font-bold leading-tight tracking-[-0.015em] px-4 pb-2 pt-4">External Features</h3>
            <div className="px-4">
              <label className="flex gap-x-3 py-3 flex-row">
                <input
                  type="checkbox"
                  name="features"
                  value="garage"
                  checked={formData.features.includes('garage')}
                  onChange={handleCheckboxChange}
                  className="h-5 w-5 rounded border-[#cedbe8] border-2 bg-transparent text-[#3490f3] checked:bg-[#3490f3] checked:border-[#3490f3] checked:bg-[image:--checkbox-tick-svg] focus:ring-0 focus:ring-offset-0 focus:border-[#cedbe8] focus:outline-none"
                />
                <p className="text-[#0d141c] text-base font-normal leading-normal">Parking (Garage)</p>
              </label>
              <label className="flex gap-x-3 py-3 flex-row">
                <input
                  type="checkbox"
                  name="features"
                  value="carport"
                  checked={formData.features.includes('carport')}
                  onChange={handleCheckboxChange}
                  className="h-5 w-5 rounded border-[#cedbe8] border-2 bg-transparent text-[#3490f3] checked:bg-[#3490f3] checked:border-[#3490f3] checked:bg-[image:--checkbox-tick-svg] focus:ring-0 focus:ring-offset-0 focus:border-[#cedbe8] focus:outline-none"
                />
                <p className="text-[#0d141c] text-base font-normal leading-normal">Parking (Carport)</p>
              </label>
              <label className="flex gap-x-3 py-3 flex-row">
                <input
                  type="checkbox"
                  name="features"
                  value="off_street"
                  checked={formData.features.includes('off_street')}
                  onChange={handleCheckboxChange}
                  className="h-5 w-5 rounded border-[#cedbe8] border-2 bg-transparent text-[#3490f3] checked:bg-[#3490f3] checked:border-[#3490f3] checked:bg-[image:--checkbox-tick-svg] focus:ring-0 focus:ring-offset-0 focus:border-[#cedbe8] focus:outline-none"
                />
                <p className="text-[#0d141c] text-base font-normal leading-normal">Parking (Off-street)</p>
              </label>
              <label className="flex gap-x-3 py-3 flex-row">
                <input
                  type="checkbox"
                  name="features"
                  value="pool"
                  checked={formData.features.includes('pool')}
                  onChange={handleCheckboxChange}
                  className="h-5 w-5 rounded border-[#cedbe8] border-2 bg-transparent text-[#3490f3] checked:bg-[#3490f3] checked:border-[#3490f3] checked:bg-[image:--checkbox-tick-svg] focus:ring-0 focus:ring-offset-0 focus:border-[#cedbe8] focus:outline-none"
                />
                <p className="text-[#0d141c] text-base font-normal leading-normal">Swimming Pool</p>
              </label>
              <label className="flex gap-x-3 py-3 flex-row">
                <input
                  type="checkbox"
                  name="features"
                  value="garden"
                  checked={formData.features.includes('garden')}
                  onChange={handleCheckboxChange}
                  className="h-5 w-5 rounded border-[#cedbe8] border-2 bg-transparent text-[#3490f3] checked:bg-[#3490f3] checked:border-[#3490f3] checked:bg-[image:--checkbox-tick-svg] focus:ring-0 focus:ring-offset-0 focus:border-[#cedbe8] focus:outline-none"
                />
                <p className="text-[#0d141c] text-base font-normal leading-normal">Garden / Landscaping</p>
              </label>
              <label className="flex gap-x-3 py-3 flex-row">
                <input
                  type="checkbox"
                  name="features"
                  value="balcony"
                  checked={formData.features.includes('balcony')}
                  onChange={handleCheckboxChange}
                  className="h-5 w-5 rounded border-[#cedbe8] border-2 bg-transparent text-[#3490f3] checked:bg-[#3490f3] checked:border-[#3490f3] checked:bg-[image:--checkbox-tick-svg] focus:ring-0 focus:ring-offset-0 focus:border-[#cedbe8] focus:outline-none"
                />
                <p className="text-[#0d141c] text-base font-normal leading-normal">Balconies, Terraces, Patios</p>
              </label>
              <label className="flex gap-x-3 py-3 flex-row">
                <input
                  type="checkbox"
                  name="features"
                  value="security"
                  checked={formData.features.includes('security')}
                  onChange={handleCheckboxChange}
                  className="h-5 w-5 rounded border-[#cedbe8] border-2 bg-transparent text-[#3490f3] checked:bg-[#3490f3] checked:border-[#3490f3] checked:bg-[image:--checkbox-tick-svg] focus:ring-0 focus:ring-offset-0 focus:border-[#cedbe8] focus:outline-none"
                />
                <p className="text-[#0d141c] text-base font-normal leading-normal">Security Systems (CCTV, Alarms, Gates)</p>
              </label>
            </div>

            <div className="flex px-4 py-3 justify-end">
              <button
                type="submit"
                disabled={isSubmitting}
                className="flex min-w-[84px] max-w-[480px] cursor-pointer items-center justify-center overflow-hidden rounded-full h-12 px-5 bg-[#3490f3] text-slate-50 text-base font-bold leading-normal tracking-[0.015em] disabled:opacity-50 disabled:cursor-not-allowed"
              >
                <span className="truncate">
                  {isSubmitting ? 'Creating...' : 'Start Valuation'}
                </span>
              </button>
            </div>
          </form>
        </div>
      </div>
    </BaseLayout>
  );
};

export default CreateAppraisal;
